import logo from './logo.svg';
import './App.css';
import Header from "./components/common/Header";
import { ThemeProvider } from "@material-ui/core/styles";
import { themeOptions } from './constants/theme';

function App() {
  return (
    <ThemeProvider theme={themeOptions}>
      <div className="App">
          <Header />
      </div>
    </ThemeProvider>
  );
}

export default App;
